import React from "react";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import Typography from "@mui/material/Typography";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { format } from "date-fns";

function createData(inputDate: any, info: any) {
  const formatday = format(inputDate, "yyyy年MM月dd日 HH:mm:ss");
  return { formatday, info };
}
const UpdateInfo = () => {
  return (
    <List>
      {[
        "紹介VTR",
        "会長挨拶",
        "概要",
        "プログラム",
        "スケジュール",
        "参加登録",
        "演題登録",
        "各種ダウンロード",
        "問い合わせ",
        "広告",
      ].map((text, index) => (
        <ListItem key={text} disablePadding></ListItem>
      ))}
    </List>
  );
};

const rows = [
  createData(20230312, 159),
  createData(20230312, 237),
  createData(20230312, 262),
  createData(20230312, 305),
  createData(20230312, 356),
];
function WhatNew() {
  return (
    <div className="WhatNew">
      <Typography variant="h5" style={{ color: "red" }}></Typography>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>＜新着情報＞</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                key={row.formatday}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {row.formatday}
                </TableCell>
                <TableCell align="right">{row.info}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default WhatNew;
